import React from 'react'
class home extends React.Component{
    check = ()=>{
        this.val="Hello, Prakash"
        console.log("hello World");
    }
    render(){
        var val="prakash";
        return(
            <React.Fragment>
                <h1>Hello World</h1>
                <div>
                    <input type="button" value="Click" onClick={this.check}/>
                    <h1>hello Wolrd {this.val}</h1>
                </div>
            </React.Fragment>
        );       
    }
}
export default home;
